		genConditionalBranchoperand(JumpZero, ((sqInt)jumpTarget));
		/* begin Jump: */
		jumpTarget1 = ensureNonMergeFixupAt(targetPC);
		genoperand(Jump, ((sqInt)jumpTarget1));
